import "./style.css";
import Post from './records.json';

const Data = Post;

function DataFetching() {
    
    <div className="post">
        <h1>"hel"</h1>
        <ul>
        
            {Data.map(post => (
                <li key={post.id}>
                    <h3>Hi {post.title}</h3>
                    <p>{post.body}</p>
                </li>
            ))}

        </ul>

    </div>
}
export default DataFetching
